import React from 'react';
import Video from '../../videos/resM.mp4'
import { EnergySection, MineSection, ThemeBg, ThemeParag, ThemesContainer, ThemeSection, VideoBg } from './ThemeElements';

function Themes() {
    return (
        <ThemesContainer>
            <ThemeBg>
                <VideoBg autoPlay loop muted src= {Video} type='map/mp4' />
            </ThemeBg>
            <ThemeParag></ThemeParag>
            <ThemeSection>
                <EnergySection></EnergySection>
                <MineSection></MineSection>
            </ThemeSection>
        </ThemesContainer>
    );
};

export default Themes
